generated.css:
/* http://meyerweb.com/eric/tools/css/reset/
   v2.0 | 20110126
   License: none (public domain)
*/
html, body, div, span, applet, object, iframe,
h1, h2, h3, h4, h5, h6, p, blockquote, pre,
a, abbr, acronym, address, big, cite, code,
del, dfn, em, img, ins, kbd, q, s, samp,
small, strike, strong, sub, sup, tt, var,
b, u, i, center,
dl, dt, dd, ol, ul, li,
fieldset, form, label, legend,
table, caption, tbody, tfoot, thead, tr, th, td,
article, aside, canvas, details, embed,
figure, figcaption, footer, header, hgroup,
menu, nav, output, ruby, section, summary,
time, mark, audio, video {
  margin: 0;
  padding: 0;
  border: 0;
  font-size: 100%;
  font: inherit;
  vertical-align: baseline; }

/* HTML5 display-role reset for older browsers */
article, aside, details, figcaption, figure,
footer, header, hgroup, menu, nav, section {
  display: block; }

body {
  line-height: 1; }

ol, ul {
  list-style: none; }

blockquote, q {
  quotes: none; }

blockquote:before, blockquote:after,
q:before, q:after {
  content: '';
  content: none; }

table {
  border-collapse: collapse;
  border-spacing: 0; }

body {
  width: 70%;
  margin-left: 15%;
  display: flex;
  flex-direction: column; }
  body header {
    display: flex;
    flex-direction: row;
    align-items: flex-start; }
  body .container {
    display: flex;
    flex-direction: row;
    width: 100%; }
    body .container .sections {
      width: 100%;
      display: flex;
      flex-direction: column; }
    body .container .list {
      display: flex;
      align-self: flex-start; }
    body .container .form {
      display: flex;
      flex-direction: column;
      align-self: flex-start; }

form {
  display: flex;
  flex-direction: column;
  align-items: center; }
  form button {
    margin-top: 10px; }

table {
  display: flex;
  flex-direction: column;
  width: 100%; }
  table thead {
    display: flex;
    width: 100%; }
    table thead tr {
      width: 100%;
      display: flex;
      flex-direction: row;
      border-bottom: 1px black solid; }
      table thead tr th {
        width: 100%;
        display: flex;
        align-items: center;
        justify-content: center; }
  table tbody {
    width: 100%;
    display: flex;
    flex-direction: column; }
    table tbody tr {
      width: 100%;
      display: flex;
      border-bottom: 1px black solid; }
      table tbody tr th {
        width: 100%;
        display: flex;
        align-items: center;
        justify-content: center; }
    table tbody :hover {
      background-color: grey; }

button {
  width: 100px;
  height: 30px;
  background-color: green; }

.form-input {
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center; }
  .form-input label {
    display: flex; }
  .form-input input {
    display: flex; }
